  return (
    <>
      <button className={classes.chooseBtn} onClick={(e) => {e.preventDefault(); setModal(true)}}>
        All categories
        <AngleDown className={classes.angle} />
      </button>
      <Modal visible={modal} setVisible={setModal}>dddddddddddddddddddd</Modal>
    </>
  );
};

